Heti Valóság – "összeomlás szélén a vízügyi ágazat"! 

A kormány hazugságokra, propagandára építi a hatalmát, miközben a legfontosabb rendszerek az összeomlás szélére kerülnek. A magyarországi víziközmű-hálózat borzalmas állapotban van:
▪️ csupán a vízrendszerek 20%-a rendelkezik megfelelő minősítéssel;
▪️ a meghibásodások száma 2012 óta a duplájára növekedett;
▪️ a vezetékes víz 25%-a el sem jut a fogyasztókhoz;
▪️ SEHOL az a több ezer milliárd forint, amire szükség lenne középtávon a pótlási és karbantartási munkákhoz.

Az ágazatban óriási a munkaerőhiány, szakemberhiány. Az LMP törvényjavaslatot nyújtott be, amelyben a vízszolgáltatókat (is) terhelő közműadó kivezetését szorgalmaztuk, azonban a Fidesz-KDNP ezt leszavazta. Részletesebb információk (felszólalások, törvényjavaslatok, írásbeli kérdések, stb.) itt : http://keresztes.hu/?p=1083
